  \"2015-07-08T19:06:22.631491\",\n\t\"name\": \"anthropogenic-biomes-of-the-world-version-1\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Anthropogenic Biomes of the World Dataset,
  Version 1 describes globally-nsignificant ecological patterns within the terrestrial
  biosphere caused nnby sustained direct human interaction with ecosystems, including
  agriculture, urbanization, forestry and other land uses. nnConventional biomes,
  such as tropical rainforests or grasslands, nnare based on global vegetation patterns
  related to climate. Now that humans have fundamentally altered global patterns of
  nnecosystem form, process, and biodiversity, anthropogenic biomes nnprovide a contemporary
  view of the terrestrial biosphere in its human-altered form. Anthropogenic biomes
  may also be termed nn\"anthromes\" to distinguish them from conventional biome nnsystems,
  or \"human biomes\" (a simpler but less precise term). This dataset is distributed
  by the Columbia University Center nnfor International Earth Science Information
  Network nn(CIESIN).\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
